  return (
    <SC_AlarmsWrap>
      <h2>알림</h2>
      <RoundTab currTab={setCurTab} />
      <TableList currTab={curTab} />
    </SC_AlarmsWrap>
  );
};

const SC_AlarmsWrap = styled.div`
  max-width: 1440px;
  margin: 0 auto;

  h2 {
    padding: 0 24px;
    margin-top: 64px;
    margin-bottom: 115px;
  }
`;
export default Alarms;
